import React from 'react';
import { useNavigate } from 'react-router-dom';
import './StudentDashboard.css';

const StudentDashboard = ({ studentData }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear authentication and redirect to login
    navigate('/login');
  };

  if (!studentData) {
    return <div>Loading student data...</div>;
  }

  return (
    <div className="student-dashboard">
      <header className="dashboard-header">
        <div className="header-content">
          <h1>Student Dashboard</h1>
          <div className="user-info">
            <span>Welcome, {studentData.first_name} {studentData.last_name}</span>
            <button onClick={handleLogout} className="logout-btn">Logout</button>
          </div>
        </div>
      </header>

      <div className="dashboard-content">
        <div className="welcome-card">
          <h2>Welcome to Pateros Technological College</h2>
          <p>Student Number: <strong>{studentData.student_number}</strong></p>
          <p>Program: <strong>{studentData.program_enrolled}</strong></p>
          <p>Year Level: <strong>{studentData.year_level}</strong></p>
          <p>Status: <span className="status-active">{studentData.enrollment_status}</span></p>
        </div>

        <div className="dashboard-grid">
          <div className="dashboard-card">
            <h3>Academic Information</h3>
            <p>View your grades, schedule, and academic progress.</p>
            <button className="card-btn">View Academics</button>
          </div>

          <div className="dashboard-card">
            <h3>Application Status</h3>
            <p>Check the status of your applications and requirements.</p>
            <button className="card-btn">Check Status</button>
          </div>

          <div className="dashboard-card">
            <h3>Student Profile</h3>
            <p>Update your personal information and contact details.</p>
            <button className="card-btn">Edit Profile</button>
          </div>

          <div className="dashboard-card">
            <h3>Campus Resources</h3>
            <p>Access library, LMS, and other campus services.</p>
            <button className="card-btn">Access Resources</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default StudentDashboard;
